import logo from './logo.svg';
import './App.css';

function MyButton() {
  function handleClick() {
    alert("How could you!");
  }
  return (
    <button onClick={handleClick}>I'm a button</button>
  );
}

function Testing(){
  return(
    <>
    <p>This is where I begin my villain monologue.</p>
    <h1>But <br /> nahhh</h1>
    </>
  );
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <body className="App-Testing">
        <p>HELLO</p>
        <MyButton />
        <Testing />
      </body>
    </div>
  );
}

export default App;
